import React from "react";
import "./App.css";

function App(){
  return(
  <> 
    <div className="bg-dark d-flex justify-content-center m-3" style={{height:"850px",position:"relative"}}>

      <div id="cadre_primary" className="bg-light rounded border border-5 border-primary  d-flex justify-content-center align-items-center">
          <div  id="dadosa-primary" class="border border-primary rounded bg-primary">  </div>
      </div>

      <div id="cadre_success" class="bg-light rounded border border-3 border-success d-flex justify-content-center align-items-center">
          <div  id="dadosa-success" class="border border-success rounded bg-success">  </div>
      </div>
    </div>
  </>
  )
}

export default App;
